import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/material.dart';
import 'package:flutter_svg/flutter_svg.dart';

class ImagePage extends StatelessWidget {
  final String image1 =
      'https://www.tnrr.in.th/wp-content/uploads/2022/12/3376-1.png';
  final String image2 =
      'https://flutter.github.io/assets-for-api-docs/assets/widgets/owl.jpg';
  final String image3 =
      'https://dev.w3.org/SVG/tools/svgweb/samples/svg-files/acid.svg';

  // https://icons8.com/preloaders
  final String loading = 'assets/icons/loading.gif';

  final String image = 'assets/images/flutter.png';

  Uint8List get imageBytes => base64Decode(
        '',
      );

  @override
  Widget build(BuildContext context) {
    return Column(
      crossAxisAlignment: CrossAxisAlignment.start,
      children: [
        Text('SvgPicture.network'),
        SvgPicture.network(image3),
        Text('Image.memory'),
        Image.memory(imageBytes),
        Text('Image.asset'),
        Image.asset(image, errorBuilder: (a, b, c) => Text('ERROR!')),
        Text('Image.network'),
        Image.network(
          image1,
          errorBuilder: (a, b, c) => Text('ERROR!'),
          loadingBuilder: (a, b, c) => Text('Loading'),
        ),
        Text('FadeInImage.assetNetwork'),
        FadeInImage.assetNetwork(placeholder: loading, image: image1),
        Text('Image(image: NetworkImage(image2))'),
        Image(
          image: NetworkImage(image2, headers: {"token": "abc"}),
          errorBuilder: (a, b, c) => Text('ERROR!'),
        ),
      ],
    );
  }
}
